INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_tagline`, `field_instagramUrl`, `field_bio`, `field_emailAddress`, `field_mailingAddress`, `field_multilineTitle`, `field_description`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '1', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2018-01-26 11:02:40', '2018-01-26 11:02:40', 'd7db53aa-ff8f-49fa-b875-9d537b1454f9'),
 ('2', '2', 'en_us', 'Homepage', 'Fashion and Creative Consultant', NULL, NULL, NULL, NULL, NULL, NULL, '2018-01-26 11:02:43', '2018-01-29 14:50:38', '7d5ceddf-04d9-4349-9eb9-b9c2a2aa16d7'),
 ('4', '4', 'en_us', NULL, NULL, 'https://www.instagram.com/havanalaffitte/', NULL, NULL, NULL, NULL, 'Fashion and Creative Consultant', '2018-01-26 11:18:32', '2018-01-29 12:14:56', 'bd57b64d-60e5-48fc-8cd0-cf3dbe212d05'),
 ('5', '5', 'en_us', 'Information', NULL, 'https://www.instagram.com/havanalaffitte/', '<p>Havana Laffitte began her fashion career as a young stylist in the mid nineties collaborating with photographers Davide Sorrenti, Terry Richardson and Mark Borthwick for magazine titles such as Interview, The Face, i-D, Spin and Visionaire. </p>\n<p>\n</p>\n<p>Simultaneously during this time , Havana’s close ties to the music industry lead to costume designing music videos for hip hop legends Ol’ Dirty Bastard, Wu Tang Clan, The Fugees, as well as indie bands like Garbage, Sebadoh and Fiona Apple.  A fixture among the now iconic  “Grunge/ Minimalism” NY Downtown Scene of 90’s fashion photography, art and skate culture, Havana also participated in Sonic Youth’s seminal <i>Sugar Cane</i> video. </p>\n<p>\n</p>\n<p>Havana has held posts at a number of publications over the years as Contributing Fashion Editor i-D Magazine (1996-2014), Fashion Director Nylon Magazine (1998-2000), Senior Fashion Editor Nova Magazine ( 2000-2002),  Contributing Fashion Editor Teen Vogue Magazine ( 2004-2015),  Fashion Director Let’s Panic Magazine ( 2014- present) as well as contributed as freelance editor to numerous global publications: American Vogue, Vogue Japan, Vogue Italia, W Korea and more.</p>\n<p>\n</p>\n<p>Throughout her career, Havana has collaborated on product design and branded content for fashion brands Gucci, DKNY, Yohji Yamamoto, Romeo Gigli, Cerrutti 1881, Victoria’s Secret, Calvin Klein, Michael Kors, Kate and Jack Spade, Levi’s, Barneys New York, Sephora, and Shinsegae.</p>\n<p>\n</p>\n<p>Havana’s interest in Cinema, Documentary, Fine Art and Fashion photography has led to collaborations with Bruce Weber, Alasdair McClellan, Patrick Demarchelier, Jim Goldberg, Roe Ethridge, Karim Sadli, Colin Dodgson, Theo Wenner, Yelena Yemchuk to name but a few. </p>\n<p>\n</p>\n<p>Contemporary art and youth culture have consistently informed Havana’s vision and she believes strongly in the role this now plays within the fashion community. From casting, to product design and marketing initiatives Havana believes that paying close attention to emerging cultural trends is essential to the successful development, creation and sharing of branded content across all channels of communication.</p>\n<p>\n</p>\n<p>As a natural extension of her work as an editor and stylist, Havana has recently redirected her focus from publishing to marketing. Her extensive experience in curating branded content for a multitude of editorial platforms and working with creative teams on product initiatives have proven to be a strong asset for successful partnerships. </p>\n<p>\n</p>\n<p>In 2016 Havana co founded BeGood Studios, a new breed of creative and marketing agency, a collective of artists, filmmakers and photographers that aims to unite contemporary art, culture and relevancy to brand identity.</p>', 'hello@havanalafiette.com', '195 Chrystie St\r\nSuite 602A\r\nNew York, NY 10002', NULL, NULL, '2018-01-26 11:19:57', '2018-01-29 14:30:37', '2fc9fcae-12af-4410-adee-ec271dc9a9aa'),
 ('6', '6', 'en_us', 'Screen Shot 2018 01 26 At 11 20 50', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2018-01-26 11:29:17', '2018-01-26 11:29:17', '9e7c55a0-5742-49b5-b0e3-decc9d58f1e8'),
 ('7', '7', 'en_us', 'Screen Shot 2018 01 26 At 11 20 59', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2018-01-26 11:29:30', '2018-01-26 11:29:30', '5efd6105-864b-40c8-8bee-e7ec09ab4335'),
