 ('5', 'field', '5', 'en_us', ' havana laffitte began her fashion career as a young stylist in the mid nineties collaborating with photographers davide sorrenti terry richardson and mark borthwick for magazine titles such as interview the face i d spin and visionaire simultaneously during this time havana s close ties to the music industry lead to costume designing music videos for hip hop legends ol dirty bastard wu tang clan the fugees as well as indie bands like garbage sebadoh and fiona apple a fixture among the now iconic grunge minimalism ny downtown scene of 90 s fashion photography art and skate culture havana also participated in sonic youth s seminal sugar cane video havana has held posts at a number of publications over the years as contributing fashion editor i d magazine 1996 2014 fashion director nylon magazine 1998 2000 senior fashion editor nova magazine 2000 2002 contributing fashion editor teen vogue magazine 2004 2015 fashion director let s panic magazine 2014 present as well as contributed as freelance editor to numerous global publications american vogue vogue japan vogue italia w korea and more throughout her career havana has collaborated on product design and branded content for fashion brands gucci dkny yohji yamamoto romeo gigli cerrutti 1881 victoria s secret calvin klein michael kors kate and jack spade levi s barneys new york sephora and shinsegae havana s interest in cinema documentary fine art and fashion photography has led to collaborations with bruce weber alasdair mcclellan patrick demarchelier jim goldberg roe ethridge karim sadli colin dodgson theo wenner yelena yemchuk to name but a few contemporary art and youth culture have consistently informed havana s vision and she believes strongly in the role this now plays within the fashion community from casting to product design and marketing initiatives havana believes that paying close attention to emerging cultural trends is essential to the successful development creation and sharing of branded content across all channels of communication as a natural extension of her work as an editor and stylist havana has recently redirected her focus from publishing to marketing her extensive experience in curating branded content for a multitude of editorial platforms and working with creative teams on product initiatives have proven to be a strong asset for successful partnerships in 2016 havana co founded begood studios a new breed of creative and marketing agency a collective of artists filmmakers and photographers that aims to unite contemporary art culture and relevancy to brand identity '),
